contracts/V2/EventOrganizerV2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title EventOrganizerV2
 * @notice UNIVERSAL event organizer registry for PUSHCHAIN
 * @dev Self-contained contract - NO Platform dependency
 *
 * KEY IMPROVEMENTS FROM V1:
 * - ✅ Removed all Platform contract dependencies
 * - ✅ Self-contained organizer management
 * - ✅ Direct event recording from EventTicket contracts
 * - ✅ Simplified modifier system
 * - ✅ Auto-verification for better UX
 * - ✅ Universal Execution compatible
 *
 * ARCHITECTURE:
 * - Organizers register themselves (auto-verified)
 * - EventTicket contracts call recordEventCreation() during deployment
 * - EventTicket contracts call incrementTicketsSold() on each sale
 * - No central Platform contract needed
 */
contract EventOrganizerV2 is Ownable {
    using EnumerableSet for EnumerableSet.AddressSet;

    // ========= Data Structures =========

    struct Organizer {
        string profileUri;          // IPFS URI with full profile (off-chain)
        string contentHash;         // Hash of profile content
        uint256 registrationDate;   // CRITICAL: On-chain for reputation
        bool isVerified;            // CRITICAL: On-chain verification status
        uint256 totalEvents;        // CRITICAL: On-chain reputation metric
        uint256 totalTicketsSold;   // CRITICAL: On-chain reputation metric
        uint256 totalRevenue;       // CRITICAL: On-chain revenue tracking (in wei)
        uint256 ratingSum;          // CRITICAL: On-chain for rating calculation
        uint256 ratingCount;        // CRITICAL: On-chain for rating calculation
        address payoutAddress;      // CRITICAL: On-chain payment routing
        bool exists;                // CRITICAL: On-chain existence check
    }

    struct DeployedEvent {
        address eventContract;      // CRITICAL: Event ticket contract address
        address organizer;          // CRITICAL: Event organizer address
        uint256 eventId;            // Event ID (auto-increment)
        uint256 deployedAt;         // Deployment timestamp
        bool isActive;              // Event active status
    }

    // ========= Storage =========

    /// @notice Mapping organizer => Organizer data
    mapping(address => Organizer) public organizers;

    /// @notice Array of all registered organizers
    address[] public organizerList;

    /// @notice Set of verified organizers (for efficient lookups)
    EnumerableSet.AddressSet private _verifiedOrganizers;

    /// @notice Mapping UEA address => Original wallet address
    mapping(address => address) public ueaToOriginal;

    /// @notice Mapping Original wallet address => UEA address
    mapping(address => address) public originalToUea;

    /// @notice Array of all deployed events
    DeployedEvent[] public deployedEvents;

    /// @notice Mapping organizer => array of event indices
    mapping(address => uint256[]) public organizerEvents;

    /// @notice Mapping eventContract => eventId (for quick lookup)
    mapping(address => uint256) public eventContractToId;

    /// @notice Track authorized event contracts (for security)
    mapping(address => bool) public authorizedEventContracts;

    // ========= Custom Errors =========
    error AlreadyRegistered();
    error NotRegistered();
    error NotVerified();
    error InvalidAddress();
    error NotAuthorized();
    error InvalidRating();
    error EventNotFound();
    error UEARequired(); // New: UEA required for universal registration

    // ========= Events =========
    event OrganizerRegistered(address indexed organizer, string profileUri, uint256 timestamp);
    event OrganizerRegisteredWithUEA(
        address indexed ueaAddress, 
        address indexed originalAddress, 
        string profileUri, 
        uint256 timestamp
    );
    event OrganizerVerified(address indexed organizer, bool verified);
    event ProfileUpdated(address indexed organizer, string profileUri);
    event PayoutAddressUpdated(address indexed organizer, address newAddress);
    event EventRecorded(
        uint256 indexed eventId,
        address indexed eventContract,
        address indexed organizer,
        uint256 timestamp
    );
    event TicketsSoldIncremented(address indexed organizer, uint256 amount, uint256 revenue);
    event RatingAdded(address indexed organizer, uint256 rating, address ratedBy);
    event EventDeactivated(uint256 indexed eventId);

    // ========= Constructor =========

    constructor() Ownable(msg.sender) {
        // Owner is automatically a verified organizer
        organizers[owner()] = Organizer({
            profileUri: "",
            contentHash: "",
            registrationDate: block.timestamp,
            isVerified: true,
            totalEvents: 0,
            totalTicketsSold: 0,
            totalRevenue: 0,
            ratingSum: 0,
            ratingCount: 0,
            payoutAddress: owner(),
            exists: true
        });

        organizerList.push(owner());
        _verifiedOrganizers.add(owner());
        emit OrganizerRegistered(owner(), "", block.timestamp);
        emit OrganizerVerified(owner(), true);
    }

    // ========= Modifiers =========

    modifier onlyRegistered() {
        if (!organizers[msg.sender].exists) revert NotRegistered();
        _;
    }

    modifier onlyVerifiedOrganizer() {
        if (!organizers[msg.sender].isVerified) revert NotVerified();
        _;
    }

    // ========= Core Functions =========

    /**
     * @notice Register as an event organizer
     * @dev Auto-verified for better UX (can be revoked by owner if needed)
     *      Supports both standard and UEA registration:
     *      - Standard: Pass address(0) as _originalAddress
     *      - UEA: Pass original wallet address for mapping
     * @param _profileUri IPFS URI with organizer profile
     * @param _contentHash Hash of profile content for verification
     * @param _originalAddress Original wallet address (for UEA registration), or address(0) for standard
     */
    function registerOrganizer(
        string memory _profileUri, 
        string memory _contentHash,
        address _originalAddress
    ) external {
        // msg.sender is the address registering (could be UEA or standard address)
        address registeringAddress = msg.sender;

        // Check if already registered
        if (organizers[registeringAddress].exists) revert AlreadyRegistered();

        // If original address provided, check if it's already registered
        if (_originalAddress != address(0)) {
            if (organizers[_originalAddress].exists) revert AlreadyRegistered();
            
            // REMOVED: Don't check if _originalAddress == registeringAddress
            // For Universal Execution (UEA):
            // - msg.sender will be UEA (e.g., 0xbCC71De0C500c2307d188eFD8e70f5D24dB44431)
            // - _originalAddress will be original wallet (e.g., 0xB5568834C4AbF44384264202Bdf97139944269c7)
            // - They should ALWAYS be different for UEA registration
            // - If they happen to be same (checksum issue), still allow mapping
        }

        // Register with msg.sender as primary address
        organizers[registeringAddress] = Organizer({
            profileUri: _profileUri,
            contentHash: _contentHash,
            registrationDate: block.timestamp,
            isVerified: true, // AUTO-VERIFIED for better UX
            totalEvents: 0,
            totalTicketsSold: 0,
            totalRevenue: 0,
            ratingSum: 0,
            ratingCount: 0,
            payoutAddress: registeringAddress,
            exists: true
        });

        organizerList.push(registeringAddress);
        _verifiedOrganizers.add(registeringAddress);

        // Store UEA <-> Original mapping (if original address provided and different)
        if (_originalAddress != address(0)) {
            ueaToOriginal[registeringAddress] = _originalAddress;
            originalToUea[_originalAddress] = registeringAddress;
            
            emit OrganizerRegisteredWithUEA(registeringAddress, _originalAddress, _profileUri, block.timestamp);
        } else {
            emit OrganizerRegistered(registeringAddress, _profileUri, block.timestamp);
        }

        emit OrganizerVerified(registeringAddress, true);
    }

    /**
     * @notice Record event creation (called by EventTicket during deployment)
     * @dev Can be called by:
     *      1. Owner (admin)
     *      2. Event contract itself (if creator is registered)
     * @param eventContract Address of the deployed event contract
     * @param creator Address of the event creator/organizer
     * @return assignedEventId The assigned event ID
     */
    function recordEventCreation(
        address eventContract,
        address creator,
        uint256 _eventId
    ) external returns (uint256 assignedEventId) {
        // Authorization check:
        // 1. Owner can record any event
        // 2. Event contract can record itself (if creator is registered)
        if (msg.sender != owner()) {
            if (msg.sender != eventContract) revert NotAuthorized();
            
            // Resolve creator to primary address
            address primaryAddr = getPrimaryOrganizerAddress(creator);
            if (!organizers[primaryAddr].exists) revert NotRegistered();
        }

        if (eventContract == address(0)) revert InvalidAddress();
        
        // Resolve creator to primary address
        address primaryAddr = getPrimaryOrganizerAddress(creator);
        if (!organizers[primaryAddr].exists) revert NotRegistered();

        // Increment organizer's event count (use primary address)
        organizers[primaryAddr].totalEvents++;

        // Assign event ID (use array index)
        assignedEventId = deployedEvents.length;

        // Record the event with PRIMARY address (UEA)
        deployedEvents.push(
            DeployedEvent({
                eventContract: eventContract,
                organizer: primaryAddr, // Store primary address (UEA)
                eventId: assignedEventId,
                deployedAt: block.timestamp,
                isActive: true
            })
        );

        // Track event index for this organizer (use primary address)
        organizerEvents[primaryAddr].push(assignedEventId);

        // Map contract address to event ID
        eventContractToId[eventContract] = assignedEventId;

        // Authorize event contract
        authorizedEventContracts[eventContract] = true;

        emit EventRecorded(assignedEventId, eventContract, primaryAddr, block.timestamp);

        return assignedEventId;
    }

    /**
     * @notice Increment tickets sold counter (called by EventTicket on each sale)
     * @dev Can be called by:
     *      1. Owner (admin)
     *      2. Authorized event contracts
     * @param organizer Organizer address
     * @param amount Number of tickets sold
     * @param revenue Revenue from ticket sales (in wei)
     */
    function incrementTicketsSold(
        address organizer,
        uint256 amount,
        uint256 revenue
    ) external {
        // Authorization check:
        // 1. Owner can increment
        // 2. Authorized event contracts can increment
        if (msg.sender != owner()) {
            if (!authorizedEventContracts[msg.sender]) revert NotAuthorized();
        }

        // Resolve to primary address
        address primaryAddr = getPrimaryOrganizerAddress(organizer);
        if (!organizers[primaryAddr].exists) revert NotRegistered();

        organizers[primaryAddr].totalTicketsSold += amount;
        organizers[primaryAddr].totalRevenue += revenue;

        emit TicketsSoldIncremented(primaryAddr, amount, revenue);
    }

    /**
     * @notice Update organizer profile
     * @param _profileUri New IPFS URI
     * @param _contentHash New content hash
     */
    function updateOrganizerProfile(
        string memory _profileUri,
        string memory _contentHash
    ) external onlyRegistered {
        // Get primary address
        address primaryAddr = getPrimaryOrganizerAddress(msg.sender);
        
        organizers[primaryAddr].profileUri = _profileUri;
        organizers[primaryAddr].contentHash = _contentHash;
        emit ProfileUpdated(primaryAddr, _profileUri);
    }

    /**
     * @notice Update payout address
     * @param _newAddress New payout address
     */
    function updateOrganizerPayoutAddress(address _newAddress) external onlyRegistered {
        if (_newAddress == address(0)) revert InvalidAddress();
        
        // Get primary address
        address primaryAddr = getPrimaryOrganizerAddress(msg.sender);
        
        organizers[primaryAddr].payoutAddress = _newAddress;
        emit PayoutAddressUpdated(primaryAddr, _newAddress);
    }

    /**
     * @notice Add rating to organizer
     * @param _organizer Organizer to rate
     * @param _rating Rating (1-5)
     */
    function addOrganizerRating(address _organizer, uint256 _rating) external {
        // Resolve to primary address
        address primaryAddr = getPrimaryOrganizerAddress(_organizer);
        if (!organizers[primaryAddr].exists) revert NotRegistered();
        if (_rating < 1 || _rating > 5) revert InvalidRating();

        organizers[primaryAddr].ratingSum += _rating;
        organizers[primaryAddr].ratingCount++;

        emit RatingAdded(primaryAddr, _rating, msg.sender);
    }

    // ========= Admin Functions =========

    /**
     * @notice Verify or revoke organizer verification (owner only)
     * @param _organizer Organizer address
     * @param _verified Verification status
     */
    function verifyOrganizer(address _organizer, bool _verified) external onlyOwner {
        // Resolve to primary address
        address primaryAddr = getPrimaryOrganizerAddress(_organizer);
        if (!organizers[primaryAddr].exists) revert NotRegistered();

        organizers[primaryAddr].isVerified = _verified;

        if (_verified) {
            _verifiedOrganizers.add(primaryAddr);
        } else {
            _verifiedOrganizers.remove(primaryAddr);
        }

        emit OrganizerVerified(primaryAddr, _verified);
    }

    /**
     * @notice Deactivate event (owner or organizer only)
     * @param eventId Event ID to deactivate
     */
    function deactivateEvent(uint256 eventId) external {
        if (eventId >= deployedEvents.length) revert EventNotFound();

        DeployedEvent storage evt = deployedEvents[eventId];

        if (msg.sender != owner() && msg.sender != evt.organizer) {
            revert NotAuthorized();
        }

        evt.isActive = false;
        emit EventDeactivated(eventId);
    }

    // ========= View Functions =========

    /**
     * @notice Check if organizer is verified
     * @dev Checks both direct address and via UEA/Original mapping
     */
    function isVerifiedOrganizer(address organizer) external view returns (bool) {
        // Check direct address
        if (organizers[organizer].exists && organizers[organizer].isVerified) {
            return true;
        }

        // Check via UEA mapping (if organizer is original address)
        address ueaAddr = originalToUea[organizer];
        if (ueaAddr != address(0) && organizers[ueaAddr].exists && organizers[ueaAddr].isVerified) {
            return true;
        }

        // Check via Original mapping (if organizer is UEA address)
        address originalAddr = ueaToOriginal[organizer];
        if (originalAddr != address(0) && organizers[organizer].exists && organizers[organizer].isVerified) {
            return true;
        }

        return false;
    }

    /**
     * @notice Check if organizer exists
     * @dev Checks both direct address and via UEA/Original mapping
     */
    function organizerExists(address organizer) external view returns (bool) {
        // Check direct address
        if (organizers[organizer].exists) {
            return true;
        }

        // Check via UEA mapping (if organizer is original address)
        address ueaAddr = originalToUea[organizer];
        if (ueaAddr != address(0) && organizers[ueaAddr].exists) {
            return true;
        }

        return false;
    }

    /**
     * @notice Get the primary organizer address (UEA if exists, otherwise the input address)
     * @dev Helper function to resolve UEA <-> Original address
     */
    function getPrimaryOrganizerAddress(address organizer) public view returns (address) {
        // If organizer exists directly, return it
        if (organizers[organizer].exists) {
            return organizer;
        }

        // If organizer is an original address, return the UEA
        address ueaAddr = originalToUea[organizer];
        if (ueaAddr != address(0) && organizers[ueaAddr].exists) {
            return ueaAddr;
        }

        // Otherwise return the input address
        return organizer;
    }

    /**
     * @notice Get organizer payout address
     * @dev Resolves to primary address first
     */
    function getOrganizerPayoutAddress(address organizer) external view returns (address) {
        address primaryAddr = getPrimaryOrganizerAddress(organizer);
        if (!organizers[primaryAddr].exists) revert NotRegistered();
        return organizers[primaryAddr].payoutAddress;
    }

    /**
     * @notice Get organizer rating (average)
     * @dev Resolves to primary address first
     */
    function getOrganizerRating(address _organizer) external view returns (uint256) {
        address primaryAddr = getPrimaryOrganizerAddress(_organizer);
        Organizer memory organizer = organizers[primaryAddr];
        if (organizer.ratingCount == 0) return 0;
        return organizer.ratingSum / organizer.ratingCount;
    }

    /**
     * @notice Get organizer details
     * @dev Resolves to primary address first
     */
    function getOrganizerDetails(address organizerAddr)
        external
        view
        returns (
            string memory profileUri,
            string memory contentHash,
            uint256 registrationDate,
            bool isVerified,
            uint256 totalEvents,
            uint256 totalTicketsSold,
            uint256 totalRevenue,
            uint256 averageRating
        )
    {
        address primaryAddr = getPrimaryOrganizerAddress(organizerAddr);
        Organizer memory organizer = organizers[primaryAddr];
        uint256 avgRating = organizer.ratingCount > 0
            ? organizer.ratingSum / organizer.ratingCount
            : 0;

        return (
            organizer.profileUri,
            organizer.contentHash,
            organizer.registrationDate,
            organizer.isVerified,
            organizer.totalEvents,
            organizer.totalTicketsSold,
            organizer.totalRevenue,
            avgRating
        );
    }

    /**
     * @notice Get all verified organizers
     */
    function getVerifiedOrganizers() external view returns (address[] memory) {
        uint256 verifiedCount = _verifiedOrganizers.length();
        address[] memory verifiedList = new address[](verifiedCount);

        for (uint256 i = 0; i < verifiedCount; i++) {
            verifiedList[i] = _verifiedOrganizers.at(i);
        }

        return verifiedList;
    }

    /**
     * @notice Get total organizer count
     */
    function getOrganizerCount() external view returns (uint256) {
        return organizerList.length;
    }

    /**
     * @notice Get all deployed events
     */
    function getAllDeployedEvents() external view returns (DeployedEvent[] memory) {
        return deployedEvents;
    }

    /**
     * @notice Get total deployed events count
     */
    function getDeployedEventsCount() external view returns (uint256) {
        return deployedEvents.length;
    }

    /**
     * @notice Get events by organizer
     */
    function getEventsByOrganizer(address organizer) external view returns (uint256[] memory) {
        return organizerEvents[organizer];
    }

    /**
     * @notice Get event details
     */
    function getEventDetails(uint256 eventId)
        external
        view
        returns (
            address eventContract,
            address organizer,
            uint256 deployedAt,
            bool isActive
        )
    {
        if (eventId >= deployedEvents.length) revert EventNotFound();
        DeployedEvent memory evt = deployedEvents[eventId];
        return (evt.eventContract, evt.organizer, evt.deployedAt, evt.isActive);
    }

    /**
     * @notice Get active events only
     */
    function getActiveEvents() external view returns (DeployedEvent[] memory) {
        uint256 activeCount = 0;
        for (uint256 i = 0; i < deployedEvents.length; i++) {
            if (deployedEvents[i].isActive) {
                activeCount++;
            }
        }

        DeployedEvent[] memory activeEvents = new DeployedEvent[](activeCount);
        uint256 index = 0;
        for (uint256 i = 0; i < deployedEvents.length; i++) {
            if (deployedEvents[i].isActive) {
                activeEvents[index] = deployedEvents[i];
                index++;
            }
        }

        return activeEvents;
    }

    /**
     * @notice Get event ID by contract address
     */
    function getEventIdByContract(address eventContract) external view returns (uint256) {
        return eventContractToId[eventContract];
    }

    /**
     * @notice Check if event contract is authorized
     */
    function isAuthorizedEventContract(address eventContract) external view returns (bool) {
        return authorizedEventContracts[eventContract];
    }

    /**
     * @notice Get UEA address from original address
     * @param originalAddress Original wallet address
     * @return UEA address (or zero address if not mapped)
     */
    function getUEAFromOriginal(address originalAddress) external view returns (address) {
        return originalToUea[originalAddress];
    }

    /**
     * @notice Get original address from UEA address
     * @param ueaAddress UEA address
     * @return Original wallet address (or zero address if not mapped)
     */
    function getOriginalFromUEA(address ueaAddress) external view returns (address) {
        return ueaToOriginal[ueaAddress];
    }
}

contracts/V2/EventTicketV2.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/interfaces/IERC2981.sol";

/**
 * @title EventTicketV2 - Universal Event Ticketing
 * @notice PUSHCHAIN Universal Execution Compatible E-Ticketing NFT
 * @dev Self-contained event ticket contract with automatic organizer registry
 *
 * KEY FEATURES V2:
 * - ✅ Universal Execution Account (UEA) Support
 * - ✅ Multi-chain tracking with buyerChain field
 * - ✅ Self-registers to EventOrganizer (no Platform dependency)
 * - ✅ Smart minting: _mint for contracts (UEA), _safeMint for EOA
 * - ✅ Constructor compatible with frontend (V2 compatibility)
 * - ✅ EIP-2981 Royalty support
 * - ✅ Transfer restriction for used tickets
 *
 * PUSHCHAIN FEATURES:
 * - buyerChain: Tracks which chain the buyer purchased from
 * - UEA Support: Handles contract-based accounts on Push Chain
 * - Cross-chain metadata: IPFS for universal accessibility
 */

// ========= Interfaces =========

interface IEventOrganizerV2 {
    function recordEventCreation(
        address eventContract,
        address creator,
        uint256 eventId
    ) external returns (uint256);

    function incrementTicketsSold(
        address organizer,
        uint256 amount,
        uint256 revenue
    ) external;

    function organizerExists(address organizer) external view returns (bool);
}

contract EventTicketV3 is ERC721, ERC721Enumerable, Ownable, IERC2981 {
    using Strings for uint256;

    // ========= Storage =========

    /// @notice EventOrganizer contract (optional - for auto-registration)
    address public eventOrganizerContract;

    /// @notice Event ID (assigned by EventOrganizer or set manually)
    uint256 public eventId;

    /// @notice Event organizer address
    address public organizer;

    /// @notice Token ID counter
    uint256 private _tokenIdCounter;

    // ========= Event Data (CRITICAL: On-chain) =========

    string public eventName;
    uint256 public eventDate;
    string public eventVenue;
    string public venueAddress;
    string public venueCoordinates;
    string public eventImageUri;
    uint256 public maxSupply;
    uint256 public ticketPrice;
    bool public eventCancelled;
    bool public eventPaused;
    uint256 public refundDeadline;
    string public eventDescription;

    // ========= Metadata & Royalty =========

    string public metadataUri; // IPFS base URI
    string public contentHash; // Metadata hash for verification
    uint96 public royaltyPercent; // Royalty in basis points (250 = 2.5%)

    // ========= Ticket Tracking =========

    /// @notice Track used tickets
    mapping(uint256 => bool) public used;

    /// @notice Track buyer chain per token (PUSHCHAIN FEATURE)
    mapping(uint256 => string) public tokenBuyerChain;

    /// @notice Track original buyer per token
    mapping(uint256 => address) public tokenOriginalBuyer;

    /// @notice Track purchase price per token
    mapping(uint256 => uint256) public tokenPurchasePrice;

    // ========= Refund Mechanism =========

    bool public refundsEnabled;
    mapping(address => uint256) public refundedTicketCount; // Track how many tickets refunded per user
    mapping(uint256 => bool) public isRefunded; // Track which specific tokens are refunded
    uint256 public totalRefundsClaimed;
    bool public fundsWithdrawn;

    // ========= Events =========

    event TicketMinted(
        address indexed buyer,
        uint256 indexed tokenId,
        uint256 price,
        string buyerChain
    );
    event TicketUsed(address indexed user, uint256 indexed tokenId, uint256 timestamp);
    event EventCancelled(uint256 timestamp);
    event EventPaused(uint256 timestamp);
    event EventResumed(uint256 timestamp);
    event RefundClaimed(address indexed user, uint256 amount, uint256[] tokenIds);
    event PartialRefundClaimed(address indexed user, uint256 amount, uint256 ticketCount, uint256[] tokenIds);
    event FundsWithdrawn(address indexed organizer, uint256 amount);
    event EventOrganizerSet(address indexed eventOrganizer);

    // ========= Custom Errors =========

    error EventIsCancelled();
    error EventIsPaused();
    error SoldOut();
    error InsufficientPayment();
    error NotTokenOwner();
    error TicketAlreadyUsed();
    error EventNotEnded();
    error RefundsNotEnabled();
    error RefundDeadlinePassed();
    error NoTicketsOwned();
    error NoUnusedTickets();
    error TicketAlreadyRefunded();
    error InsufficientBalance();
    error RefundTransferFailed();
    error FundsAlreadyWithdrawn();
    error RefundsAreEnabled();
    error NoFundsToWithdraw();
    error WithdrawalFailed();
    error CannotWithdrawWithPendingRefunds();

    // ========= Constructor =========

    /**
     * @notice Deploy EventTicketV3
     * @dev Constructor compatible with V2 frontend (no breaking changes)
     *
     * PARAMETER MAPPING (V2 compatibility):
     * - _totalSupply → maxSupply
     * - _eventOrganizerContract → eventOrganizerContract
     * - Auto-generates: eventId (via recordEventCreation), royaltyPercent (2.5%)
     *
     * NEW V3 FEATURES:
     * - Auto-registers to EventOrganizer (if provided)
     * - Sets up buyerChain tracking
     * - UEA support enabled
     */
    constructor(
        uint256 _totalSupply, // 1. Total ticket supply
        uint256 _ticketPrice, // 2. Price per ticket (wei)
        string memory _nftName, // 3. NFT collection name
        string memory _nftSymbol, // 4. NFT symbol
        string memory _eventName, // 5. Event name
        uint256 _eventDate, // 6. Event date (unix timestamp)
        string memory _eventVenue, // 7. Venue name
        string memory _venueAddress, // 8. Full venue address
        string memory _venueCoordinates, // 9. Lat,Lon coordinates
        string memory _eventImageUri, // 10. Event image IPFS URI
        string memory _metadataUri, // 11. Metadata base URI (IPFS)
        address _eventOrganizerContract, // 12. EventOrganizer contract
        string memory _eventDescription // 13. Event description
    ) ERC721(_nftName, _nftSymbol) Ownable(msg.sender) {
        // Map parameters to state variables
        maxSupply = _totalSupply;
        ticketPrice = _ticketPrice;
        eventName = _eventName;
        eventDescription = _eventDescription;
        eventDate = _eventDate;
        eventVenue = _eventVenue;
        venueAddress = _venueAddress;
        venueCoordinates = _venueCoordinates;
        eventImageUri = _eventImageUri;
        metadataUri = _metadataUri;

        // V3 defaults
        eventId = 0; // Will be set by EventOrganizer
        organizer = msg.sender; // Deployer is organizer
        eventOrganizerContract = _eventOrganizerContract;
        royaltyPercent = 250; // Default 2.5% royalty
        refundDeadline = _eventDate + 30 days; // 30 days after event

        // Generate content hash
        if (bytes(_metadataUri).length > 0) {
            contentHash = string(abi.encodePacked(keccak256(abi.encodePacked(_metadataUri))));
        }

        // AUTO-REGISTER to EventOrganizer (V3 feature)
        if (_eventOrganizerContract != address(0)) {
            try
                IEventOrganizerV2(_eventOrganizerContract).recordEventCreation(
                    address(this),
                    msg.sender,
                    0 // eventId will be auto-assigned
                )
            returns (uint256 assignedId) {
                eventId = assignedId;
            } catch {
                // Silent fail - event can still function without registration
                // Frontend can call recordEventCreation manually if needed
            }
        }
    }

    // ========= Core Functions =========

    /**
     * @notice Mint a ticket NFT - UNIVERSAL EXECUTION COMPATIBLE
     * @dev PUSHCHAIN V3 IMPROVEMENT:
     *      - Detects UEA (contract address) and uses _mint
     *      - Detects EOA and uses _safeMint
     *      - Tracks buyerChain for multi-chain support
     *      - Auto-updates EventOrganizer stats
     *
     * @return tokenId Newly minted token ID
     */
    function mintTicket() external payable returns (uint256) {
        if (eventCancelled) revert EventIsCancelled();
        if (eventPaused) revert EventIsPaused();
        if (_tokenIdCounter >= maxSupply) revert SoldOut();
        if (msg.value < ticketPrice) revert InsufficientPayment();

        uint256 tokenId = _tokenIdCounter;
        _tokenIdCounter++;

        // UNIVERSAL EXECUTION COMPATIBLE MINTING (V3 CORE FEATURE)
        // UEAs are contract addresses on Push Chain but don't implement IERC721Receiver
        // Use _mint for contracts (UEA), _safeMint for EOAs
        if (msg.sender.code.length > 0) {
            // Contract address (UEA) - use _mint to skip receiver check
            _mint(msg.sender, tokenId);
        } else {
            // EOA - use _safeMint for safety
            _safeMint(msg.sender, tokenId);
        }

        // Track purchase metadata (PUSHCHAIN V3 FEATURE)
        tokenBuyerChain[tokenId] = _chainString(); // NEW: buyerChain tracking
        tokenOriginalBuyer[tokenId] = msg.sender;
        tokenPurchasePrice[tokenId] = msg.value;

        emit TicketMinted(msg.sender, tokenId, msg.value, tokenBuyerChain[tokenId]);

        // Auto-update EventOrganizer stats (V3 integration)
        if (eventOrganizerContract != address(0)) {
            try
                IEventOrganizerV2(eventOrganizerContract).incrementTicketsSold(
                    organizer,
                    1,
                    ticketPrice
                )
            {} catch {
                // Silent fail - don't block ticket purchase if stats update fails
            }
        }

        return tokenId;
    }

    /**
     * @notice Use/validate a ticket - UNIVERSAL EXECUTION COMPATIBLE
     * @dev Can be called from any chain via UEA
     * @param tokenId Token ID to validate
     */
    function useTicket(uint256 tokenId) external {
        if (ownerOf(tokenId) != msg.sender) revert NotTokenOwner();
        if (used[tokenId]) revert TicketAlreadyUsed();
        if (block.timestamp > eventDate + 1 days) revert EventNotEnded(); // 1 day grace
        if (eventCancelled) revert EventIsCancelled();

        used[tokenId] = true;
        emit TicketUsed(msg.sender, tokenId, block.timestamp);
    }

    // ========= Organizer Functions =========

    modifier onlyOrganizer() {
        require(msg.sender == organizer || msg.sender == owner(), "Only organizer or owner");
        _;
    }

    function pauseEvent() external onlyOrganizer {
        require(!eventPaused, "Already paused");
        eventPaused = true;
        emit EventPaused(block.timestamp);
    }

    function resumeEvent() external onlyOrganizer {
        require(eventPaused, "Not paused");
        eventPaused = false;
        emit EventResumed(block.timestamp);
    }

    function cancelEvent() external onlyOrganizer {
        require(!eventCancelled, "Already cancelled");
        eventCancelled = true;
        refundsEnabled = true; // Automatic refund when cancelled
        emit EventCancelled(block.timestamp);
    }

    function updateEventName(string memory newName) external onlyOrganizer {
        eventName = newName;
    }

    function updateEventDescription(string memory newDescription) external onlyOrganizer {
        eventDescription = newDescription;
    }

    function updateEventImage(string memory newImageUri) external onlyOrganizer {
        eventImageUri = newImageUri;
    }

    function updateMetadataUri(string memory newUri) external onlyOrganizer {
        metadataUri = newUri;
        if (bytes(newUri).length > 0) {
            contentHash = string(abi.encodePacked(keccak256(abi.encodePacked(newUri))));
        }
    }

    function setEventOrganizerContract(address _eventOrganizer) external onlyOrganizer {
        eventOrganizerContract = _eventOrganizer;
        emit EventOrganizerSet(_eventOrganizer);
    }

    function setRoyaltyPercent(uint96 newPercent) external onlyOrganizer {
        require(newPercent <= 1000, "Royalty too high"); // Max 10%
        royaltyPercent = newPercent;
    }

    /**
     * @notice Withdraw funds after event (organizer only)
     * @dev SAFETY: Cannot withdraw if refunds are enabled OR before refund deadline
     *      Ensures users can claim refunds for cancelled events
     */
    function withdrawFunds() external onlyOrganizer {
        if (fundsWithdrawn) revert FundsAlreadyWithdrawn();
        if (block.timestamp <= eventDate) revert EventNotEnded();
        if (refundsEnabled && block.timestamp <= refundDeadline) revert CannotWithdrawWithPendingRefunds();

        uint256 balance = address(this).balance;
        if (balance == 0) revert NoFundsToWithdraw();

        fundsWithdrawn = true;

        (bool success, ) = payable(organizer).call{value: balance}("");
        if (!success) revert WithdrawalFailed();

        emit FundsWithdrawn(organizer, balance);
    }

    // ========= Refund Mechanism =========

    /**
     * @notice Claim partial or full refund for cancelled event
     * @dev NEW V3 FEATURE: Supports partial refunds!
     *      - Only refunds UNUSED tickets
     *      - Burns refunded tickets
     *      - User can claim multiple times until all unused tickets refunded
     *      - Protects EO: Used tickets cannot be refunded
     */
    function claimRefund() external {
        if (!refundsEnabled) revert RefundsNotEnabled();
        if (block.timestamp > refundDeadline) revert RefundDeadlinePassed();

        uint256 balance = balanceOf(msg.sender);
        if (balance == 0) revert NoTicketsOwned();

        // Collect all UNUSED tickets
        uint256[] memory unusedTokenIds = new uint256[](balance);
        uint256 unusedCount = 0;

        for (uint256 i = 0; i < balance; i++) {
            uint256 tokenId = tokenOfOwnerByIndex(msg.sender, i);
            
            // Only refund unused and not-yet-refunded tickets
            if (!used[tokenId] && !isRefunded[tokenId]) {
                unusedTokenIds[unusedCount] = tokenId;
                unusedCount++;
            }
        }

        if (unusedCount == 0) revert NoUnusedTickets();

        // Calculate refund amount (only for unused tickets)
        uint256 refundAmount = unusedCount * ticketPrice;
        if (address(this).balance < refundAmount) revert InsufficientBalance();

        // Mark tickets as refunded and burn them
        uint256[] memory refundedTokens = new uint256[](unusedCount);
        for (uint256 i = 0; i < unusedCount; i++) {
            uint256 tokenId = unusedTokenIds[i];
            isRefunded[tokenId] = true;
            refundedTokens[i] = tokenId;
            
            // Burn the ticket NFT after refund
            _burn(tokenId);
        }

        // Update refund tracking
        refundedTicketCount[msg.sender] += unusedCount;
        totalRefundsClaimed += refundAmount;

        // Transfer refund
        (bool success, ) = payable(msg.sender).call{value: refundAmount}("");
        if (!success) revert RefundTransferFailed();

        // Emit appropriate event
        if (unusedCount == balance) {
            // Full refund (all tickets unused)
            emit RefundClaimed(msg.sender, refundAmount, refundedTokens);
        } else {
            // Partial refund (some tickets used)
            emit PartialRefundClaimed(msg.sender, refundAmount, unusedCount, refundedTokens);
        }
    }

    /**
     * @notice Get refund eligibility info for a user
     * @dev Useful for frontend to display refund status
     * @return canClaim Whether user has refundable tickets
     * @return unusedTicketCount Number of unused tickets
     * @return usedTicketCount Number of used tickets
     * @return refundAmount Potential refund amount (for unused tickets)
     */
    function getRefundInfo(address user)
        external
        view
        returns (
            bool canClaim,
            uint256 unusedTicketCount,
            uint256 usedTicketCount,
            uint256 refundAmount
        )
    {
        if (!refundsEnabled || block.timestamp > refundDeadline) {
            return (false, 0, 0, 0);
        }

        uint256 balance = balanceOf(user);
        if (balance == 0) {
            return (false, 0, 0, 0);
        }

        uint256 unusedCount = 0;
        uint256 usedCount = 0;

        for (uint256 i = 0; i < balance; i++) {
            uint256 tokenId = tokenOfOwnerByIndex(user, i);
            
            if (isRefunded[tokenId]) {
                // Already refunded, skip
                continue;
            } else if (used[tokenId]) {
                usedCount++;
            } else {
                unusedCount++;
            }
        }

        bool eligible = unusedCount > 0 && address(this).balance >= (unusedCount * ticketPrice);
        uint256 potentialRefund = unusedCount * ticketPrice;

        return (eligible, unusedCount, usedCount, potentialRefund);
    }

    // ========= View Functions =========

    function getTicketsRemaining() external view returns (uint256) {
        return maxSupply - _tokenIdCounter;
    }

    function isTicketUsed(uint256 tokenId) external view returns (bool) {
        require(_ownerOf(tokenId) != address(0), "Token does not exist");
        return used[tokenId];
    }

    function getEventInfo()
        external
        view
        returns (
            string memory name,
            uint256 date,
            string memory venue,
            uint256 price,
            uint256 remaining,
            bool cancelled,
            bool paused
        )
    {
        return (
            eventName,
            eventDate,
            eventVenue,
            ticketPrice,
            maxSupply - _tokenIdCounter,
            eventCancelled,
            eventPaused
        );
    }

    /**
     * @notice Get detailed event information (V3 improvement)
     */
    function getEventDetails()
        external
        view
        returns (
            string memory name,
            uint256 date,
            string memory venue,
            string memory vAddress,
            string memory coordinates,
            string memory imageUri,
            uint256 supply,
            uint256 price,
            uint256 sold,
            uint256 remaining,
            bool cancelled,
            bool paused,
            uint8 status, // 0=Active, 1=SoldOut, 2=Ended, 3=Cancelled
            address org,
            string memory description
        )
    {
        uint8 eventStatus;
        if (eventCancelled) {
            eventStatus = 3;
        } else if (_tokenIdCounter >= maxSupply) {
            eventStatus = 1;
        } else if (block.timestamp > eventDate) {
            eventStatus = 2;
        } else {
            eventStatus = 0;
        }

        return (
            eventName,
            eventDate,
            eventVenue,
            venueAddress,
            venueCoordinates,
            eventImageUri,
            maxSupply,
            ticketPrice,
            _tokenIdCounter,
            maxSupply - _tokenIdCounter,
            eventCancelled,
            eventPaused,
            eventStatus,
            organizer,
            eventDescription
        );
    }

    /**
     * @notice Get ticket metadata with buyerChain (V3 NEW FEATURE)
     */
    function getTicketMetadata(uint256 tokenId)
        external
        view
        returns (
            address owner,
            address originalBuyer,
            uint256 purchasePrice,
            string memory buyerChain,
            bool isUsed
        )
    {
        require(_ownerOf(tokenId) != address(0), "Token does not exist");
        return (
            ownerOf(tokenId),
            tokenOriginalBuyer[tokenId],
            tokenPurchasePrice[tokenId],
            tokenBuyerChain[tokenId],
            used[tokenId]
        );
    }

    /**
     * @notice Get ticket details by token ID (V2 compatibility)
     */
    function getTicketDetails(uint256 tokenId)
        external
        view
        returns (
            address owner,
            bool isUsed,
            string memory eName,
            uint256 eDate,
            string memory eVenue,
            string memory eImage,
            uint8 status
        )
    {
        require(_ownerOf(tokenId) != address(0), "Token does not exist");

        uint8 eventStatus;
        if (eventCancelled) {
            eventStatus = 3;
        } else if (_tokenIdCounter >= maxSupply) {
            eventStatus = 1;
        } else if (block.timestamp > eventDate) {
            eventStatus = 2;
        } else {
            eventStatus = 0;
        }

        return (ownerOf(tokenId), used[tokenId], eventName, eventDate, eventVenue, eventImageUri, eventStatus);
    }

    /**
     * @notice Get all tokens owned by an address
     */
    function getTokensByOwner(address owner) external view returns (uint256[] memory) {
        uint256 balance = balanceOf(owner);
        uint256[] memory tokens = new uint256[](balance);

        for (uint256 i = 0; i < balance; i++) {
            tokens[i] = tokenOfOwnerByIndex(owner, i);
        }

        return tokens;
    }

    /**
     * @notice Get owner's tickets with usage status
     */
    function getOwnerTicketsDetails(address owner)
        external
        view
        returns (uint256[] memory tokenIds, bool[] memory isUsed)
    {
        uint256 balance = balanceOf(owner);
        tokenIds = new uint256[](balance);
        isUsed = new bool[](balance);

        for (uint256 i = 0; i < balance; i++) {
            tokenIds[i] = tokenOfOwnerByIndex(owner, i);
            isUsed[i] = used[tokenIds[i]];
        }

        return (tokenIds, isUsed);
    }

    // ========= Internal Helpers =========

    /**
     * @notice Get chain identifier string (PUSHCHAIN V3 FEATURE)
     * @dev Format: "chain:<chainId>"
     */
    function _chainString() internal view returns (string memory) {
        return string(abi.encodePacked("chain:", block.chainid.toString()));
    }

    // ========= Token URI & Metadata =========

    function _baseURI() internal view virtual override returns (string memory) {
        return metadataUri;
    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        require(_ownerOf(tokenId) != address(0), "Token does not exist");

        // Use metadataUri if set (IPFS)
        if (bytes(metadataUri).length > 0) {
            return string(abi.encodePacked(metadataUri, tokenId.toString(), ".json"));
        }

        // Fallback: on-chain JSON
        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    Base64.encode(
                        bytes(
                            string(
                                abi.encodePacked(
                                    '{"name":"',
                                    eventName,
                                    " Ticket #",
                                    tokenId.toString(),
                                    '","description":"',
                                    eventDescription,
                                    '","image":"',
                                    eventImageUri,
                                    '","attributes":[',
                                    '{"trait_type":"Event","value":"',
                                    eventName,
                                    '"},',
                                    '{"trait_type":"Venue","value":"',
                                    eventVenue,
                                    '"},',
                                    '{"trait_type":"Used","value":"',
                                    used[tokenId] ? "Yes" : "No",
                                    '"},',
                                    '{"trait_type":"Buyer Chain","value":"',
                                    tokenBuyerChain[tokenId],
                                    '"}]}'
                                )
                            )
                        )
                    )
                )
            );
    }

    // ========= EIP-2981 Royalty =========

    function royaltyInfo(uint256, uint256 salePrice)
        external
        view
        override
        returns (address receiver, uint256 royaltyAmount)
    {
        receiver = organizer;
        royaltyAmount = (salePrice * royaltyPercent) / 10000;
    }

    // ========= Required Overrides =========

    function _update(
        address to,
        uint256 tokenId,
        address auth
    ) internal override(ERC721, ERC721Enumerable) returns (address) {
        return super._update(to, tokenId, auth);
    }

    function _increaseBalance(address account, uint128 value) internal override(ERC721, ERC721Enumerable) {
        super._increaseBalance(account, value);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, IERC165)
        returns (bool)
    {
        return interfaceId == type(IERC2981).interfaceId || super.supportsInterface(interfaceId);
    }
}

// ========= Base64 Library =========

library Base64 {
    string internal constant TABLE = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/";

    function encode(bytes memory data) internal pure returns (string memory) {
        if (data.length == 0) return "";
        string memory table = TABLE;
        uint256 encodedLen = 4 * ((data.length + 2) / 3);
        string memory result = new string(encodedLen + 32);

        assembly {
            mstore(result, encodedLen)
            let tablePtr := add(table, 1)
            let dataPtr := data
            let endPtr := add(dataPtr, mload(data))
            let resultPtr := add(result, 32)

            for {

            } lt(dataPtr, endPtr) {

            } {
                dataPtr := add(dataPtr, 3)
                let input := mload(dataPtr)
                mstore(resultPtr, shl(248, mload(add(tablePtr, and(shr(18, input), 0x3F)))))
                resultPtr := add(resultPtr, 1)
                mstore(resultPtr, shl(248, mload(add(tablePtr, and(shr(12, input), 0x3F)))))
                resultPtr := add(resultPtr, 1)
                mstore(resultPtr, shl(248, mload(add(tablePtr, and(shr(6, input), 0x3F)))))
                resultPtr := add(resultPtr, 1)
                mstore(resultPtr, shl(248, mload(add(tablePtr, and(input, 0x3F)))))
                resultPtr := add(resultPtr, 1)
            }

            switch mod(mload(data), 3)
            case 1 {
                mstore(sub(resultPtr, 2), shl(240, 0x3d3d))
            }
            case 2 {
                mstore(sub(resultPtr, 1), shl(248, 0x3d))
            }
        }

        return result;
    }
}

